}

if (nationality == "Netherlands") {
  paste("not eligible: Dutch")
} else if (student == 2) {
  paste("not eligible: Not student")
} else if (studentProg == 2) {
  paste("not eligible: Not medical")
} else if (bach %in% 1 | bach %in% 2) {
   paste("not eligible: BSc Dutch")
} else if (mast %in% 6) {
   paste("not eligible: MSc Break")
} else if (bach %in% 3 | bach %in% 4) {
  paste("eligible: BSc English")
} else if (mast %in% 1) {
  paste("eligible: MSc Jn Coschap")
} else if (mast %in% 2) {
  paste("eligible: MSc Sr Coschap")
} else if (mast %in% c(3,4,5)) {
  paste("eligible: MSc Other")
} else {
   paste("Error: something went wront in the 'eligGroup' condition")
}

if (nationality %in% "Netherlands") {
  paste("In this study we are looking for people whose main cultural background is not from the Netherlands. This is because we aim to understand how coming to a new culture can influence an individual. You indicated that your main cultural background is Dutch. We are very sorry but this means that you cannot take part in the study. If you have any further questions (or think something went wrong) please feel free to e-mail us at j.kreienkamp@rug.nl or m.agostini@rug.nl.")
} else if (student %in% 2) {
  paste("In this study we are looking for international medical students. This is because we aim to understand how having a large number of interactions with host culture members can influence an individual. You indicated that you are not a student. We are very sorry but this means that you cannot take part in the study. If you have any further questions (or think something went wrong) please feel free to e-mail us at j.kreienkamp@rug.nl or m.agostini@rug.nl.")
} else if (studentProg %in% 2) {
  paste("In this study we are looking for international medical students. This is because we aim to understand how having a large number of interactions with host culture members can influence an individual. You indicated that you do not study medicine. We are very sorry but this means that you cannot take part in the study.If you have any further questions (or think something went wrong) please feel free to e-mail us at j.kreienkamp@rug.nl or m.agostini@rug.nl.")
} else if (bach %in% c(1, 2)) {
   paste("In this study we are looking for people who are internationals following an international medicine program (taught in English). This is because we aim to understand how coming to a new culture can influence an individual. You indicated that you follow the sustainable care  (duurzame zorg) or intramural care (intramurale zorg) track which are primarily taught in Dutch. We are very sorry but this means that you cannot take part in the study. If you have any further questions (or think something went wrong) please feel free to e-mail us at j.kreienkamp@rug.nl or m.agostini@rug.nl.")
} else if (mast %in% 6) {
   paste("In this study we are looking for international medical students that are currently interacting with Dutch people in their work context. This is because we aim to understand how having a large number of interactions with host culture members can influence an individual. You indicated that you are currently on a break (or forced to take one). We are very sorry but this means that you cannot take part in the study. If you have any further questions (or think something went wrong) please feel free to e-mail us at j.kreienkamp@rug.nl or m.agostini@rug.nl.")
} else if (bach %in% c(3, 4)) {
  paste("You are a medical student in an international bachelor and are generally eligble for the survey. However, you are either already in the system or our quota for this group is already full. We are very sorry but this means that you cannot take part in the study. If you have any further questions (or think something went wrong) please feel free to e-mail us at j.kreienkamp@rug.nl or m.agostini@rug.nl.")
} else if (mast %in% c(1:5)) {
  paste("You are an international medical student and are generally eligble for the survey. However, you are either already in the system or our quota for this group is already full. We are very sorry but this means that you cannot take part in the study. If you have any further questions (or think something went wrong) please feel free to e-mail us at j.kreienkamp@rug.nl or m.agostini@rug.nl. ")
} else {
   paste("Error: Sorry, something went wront when checking your eligibility. Please contact us at:  j.kreienkamp@rug.nl or m.agostini@rug.nl. Please include the following error code: 'Error: eligTxt' and the following id code:", session)
}

