Please make sure to fill in the survey as soon as possible. It really just takes four to five minutes. (Keep in mind that this link expires at 18:30 o'clock)
  
  `r if (length(na.omit(AOTM_Daily$ended)) == 0) {
    "Yay. your first Experience Recap!"
  } else if (as.numeric(Sys.Date() - as.Date(AOTM_Pre$ended)) %in% c(5,14,23)) {
    "It will only take a couple of minutes, get you 1 Euro, and our team another step closer to understanding the International Experience."
  } else if (as.numeric(Sys.Date() - as.Date(AOTM_Pre$ended)) %in% c(1,12,29)) {
    "For most, the recap takes less time than a Barista needs to make a good cup of cappuccino."
  } else if (as.numeric(Sys.Date() - as.Date(AOTM_Pre$ended)) %in% c(8,16,26)) {
    "For most people, the recap takes less time than scrolling through the new Facebook, Instagram, Twitter, or Reddit posts."
  } else if (as.numeric(Sys.Date() - as.Date(AOTM_Pre$ended)) %in% c(4,18,25)) {
    "Pro Tip: Some people combine the Recap with their natural breaks. Are you having a coffee or a snack and a few minutes to spare? Try whether a break is a good time for you to take the Recap."
  } else if (as.numeric(Sys.Date() - as.Date(AOTM_Pre$ended)) %in% c(10,20,28)) {
    "You are helping us connect the dots of how interactions work."
  } else if (as.numeric(Sys.Date() - as.Date(AOTM_Pre$ended)) %in% c(3,15,22)) {
    "Step by step we are building an interaction database together."
  } else if (as.numeric(Sys.Date() - as.Date(AOTM_Pre$ended)) %in% c(6,17,28)) {
    "We would love to hear how your morning was."
  } else if (as.numeric(Sys.Date() - as.Date(AOTM_Pre$ended)) %in% c(9,21,27)) {
    "This project wouldn't be possible without you. Thank you."
  } else{
    ""
  }`
  


