settings.custom_css:
.battery
{
   padding:20px;
   padding-right:30px;
}

.batFill
{
  position: relative;
  height:71px;
}
.bat-border{
  border: 4px solid black;
  border-radius: 15px;
  padding: 5px;
  display: inline-block;
}
.bat-ico{
  width:0px;
  border: 4px solid black;
  height: 61px;
  display: inline-block;
  margin-bottom: 10px;
}
.bat-text{
    font-size: 25px;
    font-family: sans-serif;
    text-align: center;
    width: 100%;
    position: absolute;
    top: 25%;
}

.caps input[type=text] {
    text-transform: uppercase;
}

.leftIndent{
    padding-left: 10%;
}

.popover-header {
    padding:8px 14px;
    background-color:#f7f7f7;
    border-bottom:1px solid #ebebeb;
    -webkit-border-radius:5px 5px 0 0;
    -moz-border-radius:5px 5px 0 0;
    border-radius:5px 5px 0 0;
}
.popover-title {
    margin:0;
    padding:0;
    background-color:transparent;
    border:none;
}
.example-popovers {
    padding:30px 0;
}
.acenter {
    text-align:center;
    margin:30px 0;
}


th, td {
    text-align: center;
    padding: 0.2em;
}


.slider.slider-horizontal{
  width: 80% !important;
}

.slider-selection {
    opacity: 0;
}

.slider-tick.round {
    /*width: 10px;*/
    background: grey;
    opacity: 0.7;
}

.slider-tick.round.in-selection{
    background: grey;
    opacity: 0.7;
}

.slider-tick-label {
    vertical-align: top;
}

.slider-handle {
    display: none;
    /*background: blue;*/
}

